  render() {
    return (
      <div id='main'>
        <Main
          question={
            <div>
              {
                Questions.map((obj, index) => {
                  return <h1>obj.question</h1>

                })}
              }
            </div>
          }
          type='checkbox'
        />
        <br></br>
        <Main
          question={this.state.person.name.first}
          type='TrueFalse'
        />
      </div>
    );
  }


